import React, { Component } from "react";

import "./Tutorial.css";

export default class AboutPathFinding extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div className="tutorial">
        <h3 className="title">About Pathfinding</h3>
        <img className="image" src={require("./../../gifs//bfs.gif")}></img>
        <h6>This short tutorial will take you through the application.</h6>
        <p className="paragraph">
          If you want to skip the tutorial, feel free to press "Skip Tutorial".
        </p>
        <div className="page">2/9</div>
        <button
          className="next"
          onClick={() => {
            this.props.incrementPage();
          }}
        >
          Next
        </button>
        <button
          className="previous"
          onClick={() => {
            this.props.decrementPage();
          }}
        >
          Previous
        </button>
        <button
          className="skip"
          onClick={() => {
            this.props.skip();
          }}
        >
          Skip Tutorial
        </button>
      </div>
    );
  }
}
